import React from "react"

function Node() {
    const nodeStyle = {
        width: 200,
        height: 200,
        borderRadius: "50%",
        fontSize: 20,
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
        color: "green",
        background: "yellow"
    }

    let value = 10;
    
    return (
        <div style={nodeStyle}><span>{value}</span></div>
    )
}

export default Node
